import React, { useState, useEffect } from 'react';
import { useLanguage } from '../contexts/LanguageContext';
import { ArrowLeft, ArrowRight, CheckCircle } from 'lucide-react';

const GuidedQuestions = ({ caseType, queueNumber, onComplete }) => {
  const { language } = useLanguage();
  const [questions, setQuestions] = useState([]);
  const [currentQuestionIndex, setCurrentQuestionIndex] = useState(0);
  const [answers, setAnswers] = useState({});
  const [loading, setLoading] = useState(true);
  const [processing, setProcessing] = useState(false);

  useEffect(() => {
    fetchQuestions();
  }, [caseType]);

  const fetchQuestions = async () => {
    try {
      const response = await fetch('http://localhost:5001/api/guided-questions', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          case_type: caseType,
          language: language
        })
      });

      if (response.ok) {
        const data = await response.json();
        setQuestions(data.questions);
      } else {
        // If no guided questions, use default questions
        setQuestions(getDefaultQuestions(caseType, language));
      }
    } catch (error) {
      console.error('Error fetching questions:', error);
      setQuestions(getDefaultQuestions(caseType, language));
    } finally {
      setLoading(false);
    }
  };

  const getDefaultQuestions = (caseType, lang) => {
    const defaultQuestions = {
      'A': [
        {
          id: 1,
          question_text: lang === 'en' 
            ? 'Are you currently in immediate danger?' 
            : '¿Estás actualmente en peligro inmediato?',
          order_num: 1
        },
        {
          id: 2,
          question_text: lang === 'en' 
            ? 'Do you have a restraining order or need one?' 
            : '¿Tienes una orden de restricción o necesitas una?',
          order_num: 2
        },
        {
          id: 3,
          question_text: lang === 'en' 
            ? 'Do you have children involved in this situation?' 
            : '¿Tienes hijos involucrados en esta situación?',
          order_num: 3
        }
      ],
      'B': [
        {
          id: 1,
          question_text: lang === 'en' 
            ? 'Are you seeking custody, support, or both?' 
            : '¿Buscas custodia, manutención o ambos?',
          order_num: 1
        },
        {
          id: 2,
          question_text: lang === 'en' 
            ? 'Do you have a current court order?' 
            : '¿Tienes una orden judicial actual?',
          order_num: 2
        },
        {
          id: 3,
          question_text: lang === 'en' 
            ? 'Are there any safety concerns for the children?' 
            : '¿Hay alguna preocupación de seguridad para los niños?',
          order_num: 3
        }
      ],
      'C': [
        {
          id: 1,
          question_text: lang === 'en' 
            ? 'Are you filing for divorce or legal separation?' 
            : '¿Estás presentando para divorcio o separación legal?',
          order_num: 1
        },
        {
          id: 2,
          question_text: lang === 'en' 
            ? 'Do you have children from this marriage?' 
            : '¿Tienes hijos de este matrimonio?',
          order_num: 2
        },
        {
          id: 3,
          question_text: lang === 'en' 
            ? 'Do you own property together that needs to be divided?' 
            : '¿Poseen propiedad juntos que necesita ser dividida?',
          order_num: 3
        }
      ],
      'D': [
        {
          id: 1,
          question_text: lang === 'en' 
            ? 'What type of family law matter do you need help with?' 
            : '¿Qué tipo de asunto de derecho de familia necesitas ayuda?',
          order_num: 1
        },
        {
          id: 2,
          question_text: lang === 'en' 
            ? 'Do you have any existing court documents?' 
            : '¿Tienes algún documento judicial existente?',
          order_num: 2
        },
        {
          id: 3,
          question_text: lang === 'en' 
            ? 'Is this an emergency situation?' 
            : '¿Es esta una situación de emergencia?',
          order_num: 3
        }
      ]
    };

    return defaultQuestions[caseType] || defaultQuestions['D'];
  };

  const handleAnswer = (answer) => {
    setAnswers(prev => ({
      ...prev,
      [currentQuestionIndex]: answer
    }));
  };

  const nextQuestion = () => {
    if (currentQuestionIndex < questions.length - 1) {
      setCurrentQuestionIndex(prev => prev + 1);
    } else {
      submitAnswers();
    }
  };

  const previousQuestion = () => {
    if (currentQuestionIndex > 0) {
      setCurrentQuestionIndex(prev => prev - 1);
    }
  };

  const submitAnswers = async () => {
    setProcessing(true);

    try {
      const response = await fetch('http://localhost:5001/api/process-answers', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          queue_number: queueNumber,
          answers: answers,
          language: language
        })
      });

      if (response.ok) {
        const data = await response.json();
        onComplete(data.summary, data.next_steps);
      }
    } catch (error) {
      console.error('Error submitting answers:', error);
    } finally {
      setProcessing(false);
    }
  };

  if (loading) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-blue-600 mx-auto mb-4"></div>
          <p className="text-gray-600">
            {language === 'en' ? 'Loading questions...' : 'Cargando preguntas...'}
          </p>
        </div>
      </div>
    );
  }

  if (questions.length === 0) {
    return (
      <div className="min-h-screen bg-gray-50 flex items-center justify-center">
        <div className="text-center">
          <CheckCircle className="w-16 h-16 text-green-500 mx-auto mb-4" />
          <h2 className="text-2xl font-bold text-gray-900 mb-2">
            {language === 'en' ? 'No Questions Available' : 'No Hay Preguntas Disponibles'}
          </h2>
          <p className="text-gray-600 mb-4">
            {language === 'en' 
              ? 'Your queue number has been generated. Please wait to be called.'
              : 'Tu número de cola ha sido generado. Por favor espera a ser llamado.'
            }
          </p>
          <button
            onClick={() => onComplete('', '')}
            className="bg-blue-600 text-white px-6 py-3 rounded-lg hover:bg-blue-700 transition-colors"
          >
            {language === 'en' ? 'Continue' : 'Continuar'}
          </button>
        </div>
      </div>
    );
  }

  const currentQuestion = questions[currentQuestionIndex];
  const currentAnswer = answers[currentQuestionIndex];

  return (
    <div className="min-h-screen bg-gray-50 flex items-center justify-center p-4">
      <div className="bg-white rounded-lg shadow-xl p-8 max-w-2xl w-full">
        {/* Progress */}
        <div className="mb-6">
          <div className="flex justify-between items-center mb-2">
            <span className="text-sm text-gray-600">
              {language === 'en' ? 'Question' : 'Pregunta'} {currentQuestionIndex + 1} {language === 'en' ? 'of' : 'de'} {questions.length}
            </span>
            <span className="text-sm text-gray-600">
              {queueNumber}
            </span>
          </div>
          <div className="w-full bg-gray-200 rounded-full h-2">
            <div 
              className="bg-blue-600 h-2 rounded-full transition-all duration-300"
              style={{ width: `${((currentQuestionIndex + 1) / questions.length) * 100}%` }}
            ></div>
          </div>
        </div>

        {/* Question */}
        <div className="mb-8">
          <h2 className="text-2xl font-bold text-gray-900 mb-4">
            {currentQuestion.question_text}
          </h2>
        </div>

        {/* Answer Options */}
        <div className="space-y-4 mb-8">
          <button
            onClick={() => handleAnswer('yes')}
            className={`w-full p-4 text-left rounded-lg border-2 transition-colors ${
              currentAnswer === 'yes'
                ? 'border-blue-500 bg-blue-50 text-blue-700'
                : 'border-gray-200 hover:border-gray-300'
            }`}
          >
            <span className="text-lg font-medium">
              {language === 'en' ? 'Yes' : 'Sí'}
            </span>
          </button>

          <button
            onClick={() => handleAnswer('no')}
            className={`w-full p-4 text-left rounded-lg border-2 transition-colors ${
              currentAnswer === 'no'
                ? 'border-blue-500 bg-blue-50 text-blue-700'
                : 'border-gray-200 hover:border-gray-300'
            }`}
          >
            <span className="text-lg font-medium">
              {language === 'en' ? 'No' : 'No'}
            </span>
          </button>

          <button
            onClick={() => handleAnswer('unsure')}
            className={`w-full p-4 text-left rounded-lg border-2 transition-colors ${
              currentAnswer === 'unsure'
                ? 'border-blue-500 bg-blue-50 text-blue-700'
                : 'border-gray-200 hover:border-gray-300'
            }`}
          >
            <span className="text-lg font-medium">
              {language === 'en' ? 'I\'m not sure' : 'No estoy seguro'}
            </span>
          </button>
        </div>

        {/* Navigation */}
        <div className="flex justify-between">
          <button
            onClick={previousQuestion}
            disabled={currentQuestionIndex === 0}
            className="flex items-center px-6 py-3 border border-gray-300 text-gray-700 rounded-lg hover:bg-gray-50 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
          >
            <ArrowLeft className="w-4 h-4 mr-2" />
            {language === 'en' ? 'Previous' : 'Anterior'}
          </button>

          <button
            onClick={nextQuestion}
            disabled={!currentAnswer}
            className="flex items-center px-6 py-3 bg-blue-600 text-white rounded-lg hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed transition-colors"
          >
            {currentQuestionIndex === questions.length - 1 
              ? (language === 'en' ? 'Submit' : 'Enviar')
              : (language === 'en' ? 'Next' : 'Siguiente')
            }
            <ArrowRight className="w-4 h-4 ml-2" />
          </button>
        </div>

        {processing && (
          <div className="mt-4 text-center">
            <div className="animate-spin rounded-full h-6 w-6 border-b-2 border-blue-600 mx-auto"></div>
            <p className="text-gray-600 mt-2">
              {language === 'en' ? 'Processing your answers...' : 'Procesando tus respuestas...'}
            </p>
          </div>
        )}
      </div>
    </div>
  );
};

export default GuidedQuestions;
